css:
@namespace url(http://www.w3.org/1999/xhtml);

@-moz-document domain("bing.com") {

body, .sb_text, .sb_h3, .sn_ul li, .ResultsCount, .sb_ph .sb_count {
    color: #777 !important;
    background: #373739 !important;
}

a.exp_trgr, a.exp_trgr ul, a.exp_trgr ul li {
    background: #444 !important;
}

.autospell{
    color: #777 !important;
}

.sa_cpoc{
    background: #444 !important;
    box-shadow: -2px 2px 2px #000;
    border: none !important;
}

.sa_as, .sa_as ul{
    background: #373739 !important;
}

.sa_om{
    background: #222 !important;
}

a.exp_trgr ul, a.exp_trgr ul li, sa_cp {
    background: #333 !important;
    color: #aaa !important;
}

#sw_hdr, .nosp.idh{
    background: #222 !important;    
}

#sw_hdr{
    box-shadow: -3px 3px 3px #000;    
}

a, .sb_link, a.sb_link, .sb_link a, .sb_h3 a, a strong {
    color: #4F769E !important;
    text-decoration: none;
}

a:visited strong, a:visited{
    color: #E77EAF !important;
}

.sw_b{
    padding: 0 0 1em !important;
    margin-top: 5px;
}

.sw_qbox{
    margin: 0 0 -0.98em !important;
}

.sb_text, .sb_h3, .sn_snip{
color: #777 !important;
}

.sw_logo{
background-image: url(data:image/png;base64,) !important;
height: 33px !important;
}

.sw_logo span{
display:none;
}

.sw_b .sw_sb, .sw_b .sw_qbtn{
background-image: url(data:image/png;base64,) !important;
background-position: 0 0 !important;
}

.idd table{
    background-color: #222 !important;
    border: 1px solid #000 !important;
    box-shadow: -2px 2px 2px #000;
}

}
